import React, { Component } from 'react'

export class calculator extends Component {
state = {
  amount: 0,
}
  render() {
    return (
      <div>
        <form>
            <label>
            Amount:
            <input type="text"
            name="title"
            value={this.state.amount}>
            </input>
            </label>
            <input type="submit" value="Submit " />
        </form>
      </div>
    )
  }
}

export default calculator
